import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import './Navbar.css'; // Import CSS file for custom styles

const Navbar = () => {
  const isAuthenticated = localStorage.getItem('access_token') !== null;
  const history = useHistory();

  const handleLogout = () => {
    localStorage.removeItem('access_token');
    localStorage.removeItem('refresh_token');
    history.push('/login');
    window.location.reload(); // Optionally reload to reset the app state
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-brand">Home</Link>
        <ul className="navbar-nav">
          <li className="nav-item">
            <Link to="/restaurants" className="nav-link">Restaurants</Link>
          </li>
          {isAuthenticated ? (
            <>
              <li className="nav-item">
                <Link to="/profile" className="nav-link">Profile</Link>
              </li>
              <li className="nav-item">
                <Link to="/winner" className="nav-link">Winner</Link>
              </li>
              <li className="nav-item">
                <button onClick={handleLogout} className="nav-button">Logout</button>
              </li>
            </>
          ) : (
            <>
              <li className="nav-item">
                <Link to="/login" className="nav-link">Login</Link>
              </li>
              <li className="nav-item">
                <Link to="/register" className="nav-link">Register</Link>
              </li>
            </>
          )}
          {/* External Links */}
          <li className="nav-item">
            <a href="https://github.com/your-repo" className="nav-link" target="_blank" rel="noopener noreferrer">GitHub</a>
          </li>
          <li className="nav-item">
            <a href="https://yourwebsite.com" className="nav-link" target="_blank" rel="noopener noreferrer">Website</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
